INSERT INTO `carreras` (`id`, `nombre`, `fotologo`, `mision`, `vision`, `fechaAniv`, `objetivos`) VALUES
(1, 'medicina', NULL, 'Somos una carrera de ciencias médicas de la Universidad Pública de El Alto, pertenecemos al área de Desarrollo de la salud y conservación del medio ambiente. Formamos profesionales médicos/as capaces de resolver problemas de salud  del perfil epidemiológico boliviano con un enfoque de Salud Familiar, Comunitaria e Intercultural con alta sensibilidad y solidaridad social, con practica investigativa, ética profesional, de acuerdo al encargo social, en el marco de la constitución política del estado plurinacional de Bolivia con libertad de pensamiento y respeto.\r\n\r\nSomos el centro del conocimiento donde la docencia, investigación y la extensión a la comunidad se integran al proceso de formación del estudiante', 'Facultad de Medicina de la Universidad Pública de El Alto acreditada de acuerdo a los estándares internacionales de acreditación de las carreras de medicina latino americana y del MERCOSUR que cumple con el encargo social en la formación de profesionales  médicos con excelencia.', NULL, 'Al final de la carrera los estudiantes habrán adquirido conocimientos en:\r\n\r\nMedicina generales con un adecuado nivel de profundidad de conocimientos en Ciencias Médicas.\r\nFormación sistemática en un conjunto de competencias relacionadas con la práctica Médica.\r\nLas enfermedades en los pacientes, en los distintos ciclos vitales y la reacción de los mismos frente a la perdida de salud; y la variación de los grupos sociales y culturales\r\nEl medio ambiente y las determinantes sociales de la enfermedad\r\nPromover una cultura Investigadora Universitaria para generar ciencia compatible con las políticas de Salud.\r\nGenerar espacios de opinión y cultura para enseñar y aprender de la sociedad.\r\nAspectos bioéticos y legales relevantes a la práctica médica\r\nSalud pública con alta competencia en la Salud Familiar Comunitaria e Intercultural.\r\nConocimientos en Patología de la Altura.\r\nConocimientos de prevención, para generar programas de capacitación.\r\nConocimientos básicos y científicos en Medicina Tradicional, Medicina Alternativa y Usos y Costumbres Regionales.\r\nEl idioma más usado en la región.\r\nMedicina Integrales.'),
(2, 'carrera de odontologia', '', 'La Carrera de Odontología de la Universidad Pública y Autónoma de El Alto tiene como misión, la formación mediante la investigación y la extensión de un Odontólogo integral con alta sensibilidad social y sólida formación científica, técnica, humanística y equidad, capaz de identificar, analizar, comprender y tratar los problemas de salud bucal en forma integral de las personas de nuestra comunidad en general, actuando con responsabilidad social y ética profesional.', 'Una Carrera de excelencia académica, con alta sensibilidad social, investigador, innovador, proactivo, flexible, que se responsabiliza por la formación de profesionales Odontólogos idóneos involucrados y comprometidos en mejorar la salud bucal en forma integral de la población en general, especialmente de los sectores más necesitados.', NULL, 'Formar profesionales que apliquen atención Odontológica integral a niños, adolescentes, adultos, mujeres embarazadas y ancianos, considerando a cada uno de ellos como una unidad Bio-psico-social.');

